const TimeSetting = ({timeinput}) =>{
    let timing=[]
    let id=0
    for(let i=0;i<=timeinput;i++){
        timing.push(i)
    }
    return (
        <>
            {timing.map(element,id =>(
                <option value={id++}>{element}</option>
            ))}        
        </>
    )

}
export default  TimeSetting
